import React from "react";

export default class Video extends React.Component {
    constructor(props) {
        super(props);
        this.state={}
    }
    render() {
        const url = require('../../media/gaoxiao.mp4')
        return (
            <div>
                <video src={url.default} />
            </div>
        )
    }
}
